// client/src/components/AddAirplaneForm.jsx
import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

export default function AddAirplaneForm() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    airlineID: '',
    tail_num: '',
    seat_capacity: '',
    speed: '',
    locationID: '',
    plane_type: '',
    maintenanced: '',
    model: '',
    neo: ''
  });
  const [msg, setMsg] = useState('');

  const handleChange = e => {
    const { name, value } = e.target;
    setForm(f => ({ ...f, [name]: value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();

    const nullify = v => (v === '' || v.toUpperCase() === 'NULL') ? null : v;
    const asBool  = v => (v === '' ? null : v === 'true');

    const submission = {
      airlineID:     form.airlineID,
      tail_num:      form.tail_num,
      seat_capacity: parseInt(form.seat_capacity, 10),
      speed:         parseInt(form.speed, 10),
      locationID:    form.locationID,
      plane_type:    form.plane_type,
      maintenanced:  asBool(form.maintenanced),
      model:         nullify(form.model),
      neo:           asBool(form.neo)
    };

    console.log('Submitting payload:', submission);

    try {
      await axios.post('/api/airplanes', submission);
      // navigate to view page, which fetches fresh data
      navigate('/view-airplanes');
    } catch (err) {
      console.error('Backend error:', err.response?.data || err);
      setMsg(err.response?.data?.error || '❌ Error adding airplane');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>add_airplane()</h2>

      <label>Airline ID:</label>
      <input
        name="airlineID"
        value={form.airlineID}
        onChange={handleChange}
        required
      />

      <label>Tail Num:</label>
      <input
        name="tail_num"
        value={form.tail_num}
        onChange={handleChange}
        required
      />

      <label>Seat Cap:</label>
      <input
        name="seat_capacity"
        type="number"
        value={form.seat_capacity}
        onChange={handleChange}
        required
      />

      <label>Speed:</label>
      <input
        name="speed"
        type="number"
        value={form.speed}
        onChange={handleChange}
        required
      />

      <label>Location ID:</label>
      <input
        name="locationID"
        value={form.locationID}
        onChange={handleChange}
        required
      />

      <label>Plane Type:</label>
      <input
        name="plane_type"
        value={form.plane_type}
        onChange={handleChange}
        required
      />

      <label>Maintenanced (optional):</label>
      <select
        name="maintenanced"
        value={form.maintenanced}
        onChange={handleChange}
      >
        <option value="">— leave blank —</option>
        <option value="true">TRUE</option>
        <option value="false">FALSE</option>
      </select>

      <label>Model (optional):</label>
      <input
        name="model"
        placeholder="Leave blank or type NULL"
        value={form.model}
        onChange={handleChange}
      />

      <label>Neo:</label>
      <select
        name="neo"
        value={form.neo}
        onChange={handleChange}
        required
      >
        <option value="">Select …</option>
        <option value="true">TRUE</option>
        <option value="false">FALSE</option>
      </select>

      <br/><br/>
      <button type="submit">Add</button>
      {msg && <p>{msg}</p>}
    </form>
  );
}
